import React, { Component } from "react";
import Rightarrow from "../../assets/images/right-arrow.svg";

class Monthselection extends Component {
  state = {
    Months: [
      {
        Rendermonth: "September 2020",
      },
      {
        Rendermonth: "August 2020",
      },
      {
        Rendermonth: "July 2020",
      },
      {
        Rendermonth: "June 2020",
      },
      {
        Rendermonth: "May 2020",
      },
      {
        Rendermonth: "April 2020",
      },
    ],
  };
  render() {
    const Renderitems = () => {
      var listItems = this.state.Months.map((items) => <li>{items}</li>);
    };

    return (
      <section className="month-wrapper">
        <h1>Select a Month</h1>
        <ul className="list-wrapper">
          <li>
            {this.state.Months[0].Rendermonth}
            <img src={Rightarrow} alt="Right Arrow" />
          </li>
          <li>
            {this.state.Months[1].Rendermonth}{" "}
            <img src={Rightarrow} alt="Right Arrow" />
          </li>
          <li>
            {this.state.Months[2].Rendermonth}{" "}
            <img src={Rightarrow} alt="Right Arrow" />
          </li>
          <li>
            {this.state.Months[3].Rendermonth}{" "}
            <img src={Rightarrow} alt="Right Arrow" />
          </li>
          <li>
            {this.state.Months[4].Rendermonth}{" "}
            <img src={Rightarrow} alt="Right Arrow" />
          </li>
          <li>
            {this.state.Months[5].Rendermonth}{" "}
            <img src={Rightarrow} alt="Right Arrow" />
          </li>
        </ul>
        {/* <Renderlist /> */}
      </section>
    );
  }
}

export default Monthselection;
